import { project } from "../project";
import "./Card.css";

export function Card (project) {
  return (
    <div className="card text-white bg-dark mb-3" id="projectCard">
      <img className="card-img-top" src={project.image} alt={project.name}/>
      <div className="card-body">
        <h4 className="card-title">{project.name}</h4>
        <p className="card-text">{project.description}</p>
      </div>
      <div className="card-footer mx-auto">
        <a className="btn btn-primary" id="activeBtn" type="button" href={project.gitHub}>Repo</a>
        <a className="btn btn-primary" id="activeBtn" type="button" href={project.deployed}>Deployed</a>
      </div>
    </div>
  )
}
